import React from "react";
import Data from "./assets/all_product"
import Card from "./Card";

export default function Popular() {
    const womenProducts = Data.filter(item => item.category === 'women');
    const lastFourWomenProducts = womenProducts.slice(-4);

    function lastFour(params) {
        return womenProducts.slice(-4);
    }

    return (
        <section className="py-5">
            <h3>. POPULAR BY WOMEN</h3>
            <hr />
            <div className="row gy-3">
                {lastFourWomenProducts.map((item, index) => {
                    return <Card key={index} title={item.title} cover={item.cover} price={item.price} date={item.date} />
                })}
            </div>
        </section>
    );
}
